  false,\n\t\"url\": null,\n\t\"notes\": \"This Water Resource Inventory and Assessment
  report for Ruby Lake National Wildlife Refuge describes current hydrologic information,
  provides an assessment of water resource needs and issues of concern, and makes
  recommendations regarding Refuge water resources.  The Water Resource Inventory
  and Assessment evaluates water quality and quantity issues, water rights, water
  management, potential threats to water supplies, hydro-climate trends, and other
  water resource issues for the Refuge.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
